(function () {
  var postMessage = function (data) {
    var message = { type: "intercept_sensitive_api", data: data };
    if (window._PDDPrivateBridge) {
      window._PDDPrivateBridge.postMessage(JSON.stringify(message));
    } else {
      if (
        window.webkit &&
        window.webkit.messageHandlers &&
        window.webkit.messageHandlers._PDDPrivateBridge
      ) {
        window.webkit.messageHandlers._PDDPrivateBridge.postMessage(message);
      } else {
        console.error(
          "INTERCEPT_SENSITIVE_API_ERROR: _PDDPrivateBridge not exist"
        );
      }
    }
  };
  if (
    navigator &&
    navigator.geolocation &&
    navigator.geolocation.getCurrentPosition
  ) {
    Object.defineProperty(navigator.geolocation, "getCurrentPosition", {
      configurable: true,
      enumerable: true,
      writable: false,
      value: function () {
        postMessage({
            intercept_method: "getCurrentPosition"
        });
        var args = [].slice.call(arguments);
        //fail callback
        if (args[1]) args[1]({
            "code": -1,
            "message": "error"
        });
        else console.info("call getCurrentPosition without success&fail callback, this is exception");
      },
    });
  }
  if (
    navigator &&
    navigator.geolocation &&
    navigator.geolocation.watchPosition
  ) {
    Object.defineProperty(navigator.geolocation, "watchPosition", {
      configurable: true,
      enumerable: true,
      writable: false,
      value: function () {
        postMessage({
            intercept_method: "watchPosition"
        });
        var args = [].slice.call(arguments);
        //fail callback
        if (args[1]) args[1]({
            "code": -1,
            "message": "error"
        });
        else console.info("call watchPosition without success&fail callback, this is exception");
      },
    });
  }
  if (
    navigator &&
    navigator.mediaDevices &&
    navigator.mediaDevices.getUserMedia
  ) {
    Object.defineProperty(navigator.mediaDevices, "getUserMedia", {
      configurable: true,
      enumerable: true,
      writable: false,
      value: function () {
        postMessage({
            intercept_method: "getUserMedia"
        });
        return Promise.reject(new Error('NotAllowed'));
      },
    });
  }
})();
